    "import random\n",
    "alpha = list(\"abcdefghijklmnopqrstuvwxyz \")\n",
    "target = \"fuck python\"\n",
    "def generate(targetLength, alphaLen, alpha):\n",
    "    out = \"\"\n",
    "    for x in range(0, targetLength):\n",
    "        x = random.randrange(alphaLen)\n",
    "        out+=alpha[x]\n",
    "    print(out)\n",
    "    \n",
    "def calcScore(string, target):\n",
    "    if string==target:\n",
    "        return 100\n",
    "    else:\n",
    "        return 0\n",
    "    \n",
    "def monkeyTypist():\n",
    "    target = list(\"methinks it is like a weasel\")\n",
    "    lenS = len(target)\n",
    "    alphabet = list(\"abcdefghijklmnopqrstuvwxyz \")\n",
    "    lenA = len(alphabet)\n",
    "    epoch = 0\n",
    "    bestStr = generate(lenS, lenA, alphabet)\n",
    "    bestScore = calcScore(bestStr, target)\n",
    "    print(\"String Score\")\n",
    "    while bestScore < 100:\n",
    "        if bestScore==100:\n",
    "            break\n",
    "        newStr = generate(lenS, lenA, alphabet)\n",
    "        newScore = calcScore(newStr, target)\n",
    "        if newScore > bestScore:\n",
    "            bestScore = newScore\n",
    "            bestStr = newStr\n",
    "        if epoch==100000:\n",
    "#             print(\"%s %d\" % (\"\".join(bestStr), bestScore))\n",
    "            epoch = 0\n",
    "        epoch = epoch+1\n",
    "# generate(len(target), len(alpha), alpha)\n",
    "monkeyTypist()"
